// src/components/DiagnosisResults.js
import React, { useEffect, useState } from 'react';
import { fetchDiagnosisResults } from '../utils/api';

function DiagnosisResults() {
  const [results, setResults] = useState([]);

  useEffect(() => {
    async function loadResults() {
      const data = await fetchDiagnosisResults(12345); // Replace 12345 with dynamic formSubmissionId
      setResults(data);
    }
    loadResults();
  }, []);

  return (
    <div className="diagnosis-results">
      <h2>Diagnosis Results</h2>
      <ul>
        {results.map((result) => (
          <li key={result.id}>{`${result.organ_name}: ${result.diagnosis_name}`}</li>
        ))}
      </ul>
    </div>
  );
}

export default DiagnosisResults;
